import React from "react";

const Landing: React.FC<{}> = () => {
  return (
    <div className="w-full h-full">
      <div>
        <div className="font-bold text-slate-400 text-xl">Hi!</div>
        <div>I'm Shwan Xue</div>
        <div>An aspiring Web Developer and Software Engineer</div>
      </div>
    </div>
  );
};

export default Landing;
